import React, { useEffect, useState } from 'react';
import { getBrands, getBearings } from '../db';
import { Bearings, Brands } from '../tables';

const App: React.FC = () => {
    const [brands, setBrands] = useState<Brands[]>([]);
    const [bearings, setBearings] = useState<Bearings[]>([]);

    useEffect(() => {
        const fetchData = async () => {
            try {
                const brandsData = await getBrands();
                setBrands(brandsData);

                const bearingsData = await getBearings();
                setBearings(bearingsData);
            } catch (err) {
                console.error('Failed to fetch data', err);
            }
        };

        fetchData();
    }, []);

    return (
        <div>
            <h1>Brands</h1>
            <ul>
                {brands.map(brand => (
                    <li key={brand.id}>{brand.name}</li>
                ))}
            </ul>

            <h1>Bearings</h1>
            <ul>
                {bearings.map(bearing => (
                    <li key={bearing.id}>
                        {bearing.name} - {bearing.brand} - {bearing.country}
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default App;
